    public static String createZip(String strXmlDoc){
        String strB64="-1";
        byte[] bytes;

        try {
            ByteArrayOutputStream bos = new ByteArrayOutputStream();
            ZipOutputStream zos = new ZipOutputStream(bos);

            Document doc=toXmlDocument(strXmlDoc);
            NodeList nodes = doc.getElementsByTagName("file");
            //  System.out.println(nodes.getLength());
            // iterate the employees
            for (int i = 0; i < nodes.getLength(); i++) {
                Element element = (Element) nodes.item(i);

                NodeList fileName = element.getElementsByTagName("fileName");
                Element line = (Element) fileName.item(0);
                zos.putNextEntry(new ZipEntry(getCharacterDataFromElement(line)));
                //   System.out.println("fileName: " + getCharacterDataFromElement(line));

                NodeList content = element.getElementsByTagName("content");
                line = (Element) content.item(0);
                bytes=getCharacterDataFromElement(line).getBytes();
                zos.write(bytes, 0, bytes.length);
                zos.closeEntry();
                //System.out.println("content: " + getCharacterDataFromElement(line));
            }

            zos.close();
            strB64 = Base64.getEncoder().encodeToString(bos.toByteArray());


        } catch (FileNotFoundException ex) {
            System.err.format("content not found"+ex.getMessage());
        } catch (IOException ex) {
            System.err.println("I/O error: " + ex);
        }

        return   strB64;
    }


    public static String unZip(String zipContent){
        byte[] buffer = new byte[1024];
        String strXmlDoc =
                "<fileList xmlns=\"http://xmlns.adb.org/pfms/v1//soa/common/FileList.xsd\">" ;
        try{
            ByteArrayInputStream  bais=new ByteArrayInputStream(Base64.getDecoder().decode(zipContent));
            ZipInputStream zis =
                    new ZipInputStream(bais);
            //get the zipped file list entry
            ZipEntry ze = zis.getNextEntry();

            while(ze!=null){

                String fileName = ze.getName();

                System.out.println(fileName);

                //create all non exists folders
                //else you will hit FileNotFoundException for compressed folder

                StringBuffer sb=new StringBuffer();

                ByteArrayOutputStream bos=new ByteArrayOutputStream();
                int len;
                while ((len = zis.read(buffer)) > 0) {

                    bos.write(buffer, 0, len);
                }

                strXmlDoc=strXmlDoc+"<file>" +
                        " <fileName>"+fileName+"</fileName>" +
                        " <content>"+Base64.getEncoder().encodeToString(bos.toByteArray())+"</content>" +
                        " </file>" ;
                bos.close();
                //   need to append to XML
                ze = zis.getNextEntry();
            }

            zis.closeEntry();
            zis.close();

            strXmlDoc=strXmlDoc+"</fileList>";
        }
        catch(Exception e){
            e.printStackTrace();
        }


        return strXmlDoc;
    }

    public static String encodeBase64Binary(String content){
        String encodedStr=null;
        try{
            encodedStr = Base64.getEncoder().encodeToString(content.getBytes());
        }
        catch(Exception e){
            e.printStackTrace();
        }
        return encodedStr;
    }

    public static String decodeBase64Binary(String content){
        String encodedStr=null;
        try{
            byte[] b= Base64.getDecoder().decode(content);
            encodedStr = new String(b);
        }
        catch(Exception e){
            e.printStackTrace();
        }
        return encodedStr;
    }

    private static Document toXmlDocument(String strRecords) {
        Document doc=null;
        try{
            System.out.println(strRecords);
            DocumentBuilderFactory dbf =
                    DocumentBuilderFactory.newInstance();
            DocumentBuilder db = dbf.newDocumentBuilder();
            InputSource is = new InputSource(new StringReader(strRecords));
            is.setCharacterStream(new StringReader(strRecords));

            doc = db.parse(is);
            System.out.println("Document "+is);
        }
        catch(Exception e) {
            e.printStackTrace();
        }
        return doc;
    }

    public static String getCharacterDataFromElement(Element e) {
        Node child = e.getFirstChild();
        if (child instanceof CharacterData) {
            CharacterData cd = (CharacterData) child;
            return cd.getData();
        }
        return "?";
    }
